let word = wordListEn[Math.floor(Math.random() * wordListEn.length)].toUpperCase();
console.log(word);


window.onload = function(){
    initialise();
}

function initialise() {
    // Create board 
    for (let i = 0; i < height; i++) {
        for ( let j = 0; j < width; j++) {
            let tile = document.createElement("span");
            tile.id = i.toString() + "-" + j.toString();
            tile.classList.add("tile");
            tile.innerText = "";
            document.getElementById("board").appendChild(tile);
        }
    }
    // Listen for Key press
    document.addEventListener("keyup",(e) => {
        if (gameOver) return; 

        if ("KeyA" <= e.code && e.code <= "KeyZ") {
            if (col < width) {
                let currTile = document.getElementById(row.toString() + "-" + col.toString());
                if (currTile.innerText == "") {
                    currTile.innerText = e.code[3];
                    col += 1;
                }
            }
        } else if (e.code == "Backspace") {
            if (0 < col  && col <= width) {
                col -= 1;
                document.getElementById("answer").innerText = "";
            }
            let currTile = document.getElementById(row.toString() + "-" + col.toString());
            currTile.innerText = "";
        } else if (e.code == "Enter") {
            update();
        }

        if (!gameOver && row == height) {
            gameOver = true;
            document.getElementById("answer").innerText = word;
        }
    })
}

function update() {
    let guess = "";
    document.getElementById("answer").innerText = "";

    //string p the guess word
    for (let c = 0; c < width; c++) {
        let currTile = document.getElementById(row.toString() + "-" + c.toString());
        let letter = currTile.innerText;
        guess += letter; 
    }

    guess = guess.toLowerCase();
    if (!wordListEn.includes(guess)) {
        document.getElementById("answer").innerText = "Not in word list";
        return;
    }

    let correct = 0;
    let letterCount = {};
for (let l = 0; l < word.length; l++) {
    letter = word[l];
    if (letterCount[letter]) {
        letterCount[letter] += 1;
    } else {
        letterCount[letter] = 1;
    }

}
    //first iteration, check all th correct ones
    for (let i = 0; i < width; i++) {
        let currTile = document.getElementById(row.toString() + "-" + i.toString());
        let letter = currTile.innerText;

        //is the letter in the correct possitin
        if (word[i] == letter) {
            currTile.classList.add("correct");
            correct += 1;
            letterCount[letter] -= 1;
        } //is the letter in the word

        if (correct == width) {
            gameOver = true;
        }
    }

    //go again and mark which ones are present but in a wrong possition
    for (let i = 0; i < width; i++) {
        let currTile = document.getElementById(row.toString() + "-" + i.toString());
        let letter = currTile.innerText;

        if (!currTile.classList.contains("correct")) {
            //is the letter in the word
            if (word.includes(letter) && letterCount[letter] > 0) {
                currTile.classList.add("present");
                letterCount[letter] -= 1;
            } // not in the word
            else {
                currTile.classList.add("absent");
            }
        }
    }

    if (correct == 5) {
        document.getElementById("answer").innerText = "You won!";
    }
    row += 1;
    col = 0; 
}

